import React from 'react';
import './contact.css';

function ContactUs() {
    return (
        <div  className="main-container-Wrapper-ContactUs-Page">
        <p className="ContactUs-page-heading-Para">Hobbies </p>
        <div className="horizontal-Line-ContactUs"></div>
        <p className="ContactUs-page-Quote-Para">Cheerful & Enthusiastic </p> 



        <div className="pageEnd-horizontal-Line-ContactUs"></div>
        </div>
    )
}

export default ContactUs;
